    function getAdvancedHyperReactorMaxParallel(machine) {
        if (machine.inputFluid("gtceu:starmetal_plasma 1")) {
            return 8
        }
        if (machine.inputFluid("gtceu:dense_neutron_plasma 1")) {
            return 16
        }
        return 1
    }

