    function getSphereOfHarmonyOC(machine) {
        if (machine.notConsumableCircuit(4)) {
            return 3
        }
        if (machine.notConsumableCircuit(3)) {
            return 2
        }
        if (machine.notConsumableCircuit(2)) {
            return 1
        }
        if (machine.notConsumableCircuit(1)) {
            return 0
        }
        return null
    }

